import React from "react";
import { Link } from "react-router-dom";
import "../mobile.css";

const Menu = props => (
  <div className="mobile-menu">
    <Link to >About Me</Link>
    <div>Languages & Frameworks</div>
    <div>Projects</div>
    <div>Contact Me</div>
  </div>
);

export default Menu;
